import React, { useEffect, useState } from 'react';
import ProductRow from '../components/ProductRow';

function Result() {
    const [activeTab, setActiveTab] = useState("Products");

    useEffect(() => {
        getData();
    }, []);

    const getData = async () => {
        const response = await fetch('https://fakestoreapi.com/products');
        const data = await response.json();
        console.log(data);
    };

    return (
        <div style={styles.container}>
            {/* Tabs */}
            <div style={styles.tabs}>
                <button
                    onClick={() => setActiveTab("Products")}
                    style={activeTab === "Products" ? styles.activeTab : styles.tab}
                >
                    Products
                </button>
                <button
                    onClick={() => setActiveTab("Other Page")}
                    style={activeTab === "Other Page" ? styles.activeTab : styles.tab}
                >
                    Other Page
                </button>
            </div>

            {/* Display content based on active tab */}
            {activeTab === "Products" && (
                <ProductRow
                    itemNumber="5517679"
                    imageSrc={require('../images/test.png')}
                    name="Vineego 50-in Modern Gray Chenille Sectional"
                    price="$429.99"
                    rating={4}
                    description="The modern sectional couch features a high-quality wooden frame with sturdy plastic legs. Its elegant chenille fabric surface complements your room's style perfectly. The fixed combination construction enhances stability and durability. This modular sofa includes a spacious double recliner, ideal for living room comfort. Its cushions are crafted from soft, elastic sponge material and filled with premium cotton for added softness and resilience."
                />
            )}
        </div>
    );
}

export default Result;

const styles = {
    container: {
        padding: '20px',
        textAlign: 'center',
    },
    tabs: {
        display: 'flex',
        justifyContent: 'center',
        marginBottom: '20px',
    },
    tab: {
        padding: '10px 20px',
        margin: '0 10px',
        border: '1px solid #ccc',
        borderRadius: '5px',
        backgroundColor: '#f5f5f5',
        cursor: 'pointer',
    },
    activeTab: {
        padding: '10px 20px',
        margin: '0 10px',
        border: '1px solid #007bff',
        borderRadius: '5px',
        backgroundColor: '#007bff',
        color: '#fff',
        cursor: 'pointer',
    }
};
